    a0 = h2 / (h1 * (h1 + h2));
    dpdx = a2 * Y2 + a1 * Y1 + a0 * Y0;

function YN = rightdYs(h1, h2, Y0, Y1, dYN)
    a2 = (2*h2 + h1) / (h2 * (h1 + h2));
    a1 = -(h1 + h2) / (h1 * h2);
    a0 = h2 / (h1 * (h1 + h2));
    YN = (dYN - a1 * Y1 - a0 * Y0) / a2;

